import React, { useState } from "react";
import { useLocation, useNavigate } from "react-router-dom";
import products from "../data/products";
import { useSearch } from "../context/SearchContext";
import { useCart } from "../context/CartContext";

const ProductsPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const params = new URLSearchParams(location.search);
  const urlCategory = params.get("category");

  // ✅ context values
  const { search, category } = useSearch();
  const { addToCart } = useCart();

  // ✅ filter products
  let filteredProducts = products;

  // filter by category (from URL or context)
  if (urlCategory && urlCategory !== "all") {
    filteredProducts = filteredProducts.filter(
      (p) => p.category.toLowerCase() === urlCategory.toLowerCase()
    );
  } else if (category && category !== "all") {
    filteredProducts = filteredProducts.filter(
      (p) => p.category.toLowerCase() === category.toLowerCase()
    );
  }

  // filter by search text
  if (search) {
    filteredProducts = filteredProducts.filter((p) =>
      p.name.toLowerCase().includes(search.toLowerCase())
    );
  }

  const handleAddToCart = (product, quantity) => {
    addToCart(product, null, quantity);
    alert(`${product.name} added to cart! ✅`);
  };

  return (
    <div style={{ padding: "20px" }}>
      <h2>
        {urlCategory
          ? `${urlCategory} Products`
          : category !== "all"
          ? `${category} Products`
          : "All Products"}
        {search && ` - Search: "${search}"`}
      </h2>

      {filteredProducts.length === 0 ? (
        <p>No products found {search && `for "${search}"`} </p>
      ) : (
        <div
          style={{
            display: "grid",
            gridTemplateColumns: "repeat(auto-fit, minmax(250px, 1fr))",
            gap: "20px",
            marginTop: "20px",
          }}
        >
          {filteredProducts.map((p) => (
            <ProductCard
              key={p.id}
              product={p}
              onAddToCart={handleAddToCart}
              onView={() => navigate(`/product/${p.id}`)}
            />
          ))}
        </div>
      )}
    </div>
  );
};

// ✅ Separate Card Component (so that useState is safe)
const ProductCard = ({ product, onAddToCart, onView }) => {
  const [quantity, setQuantity] = useState(1);

  const handleIncrease = () => setQuantity((prev) => prev + 1);
  const handleDecrease = () =>
    setQuantity((prev) => (prev > 1 ? prev - 1 : 1));

  return (
    <div
      style={{
        border: "1px solid #eee",
        borderRadius: "12px",
        padding: "15px",
        textAlign: "center",
        background: "#fff",
        boxShadow: "0 2px 8px rgba(0,0,0,0.1)",
        cursor: "pointer",
      }}
    >
      {/* IMAGE + NAME clickable */}
      <div onClick={onView}>
        <img
          src={product.image}
          alt={product.name}
          style={{
            width: "100%",
            height: "180px",
            objectFit: "contain",
          }}
        />
        <h3 style={{ margin: "10px 0", fontSize: "16px" }}>
          {product.name}
        </h3>
      </div>

      <p style={{ fontSize: "14px", color: "#555" }}>
        ({product.pieces} Pieces)
      </p>
      <p style={{ fontSize: "13px", color: "#666", margin: "8px 0" }}>
        {product.description}
      </p>
      <p style={{ color: "#FFD700", margin: "5px 0" }}>★★★★★</p>

      <p
        style={{
          fontSize: "18px",
          fontWeight: "bold",
          color: "#e63946",
        }}
      >
        ₹{product.price * quantity}
      </p>

      {product.mrp && (
        <p style={{ textDecoration: "line-through", color: "#888" }}>
          MRP: ₹{product.mrp * quantity}
        </p>
      )}

      {/* Quantity Controls */}
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          marginBottom: "10px",
          gap: "10px",
        }}
      >
        <button
          onClick={handleDecrease}
          style={{
            padding: "5px 10px",
            borderRadius: "6px",
            border: "1px solid #ccc",
            background: "#f5f5f5",
            cursor: "pointer",
          }}
        >
          -
        </button>
        <span style={{ fontWeight: "bold" }}>{quantity}</span>
        <button
          onClick={handleIncrease}
          style={{
            padding: "5px 10px",
            borderRadius: "6px",
            border: "1px solid #ccc",
            background: "#f5f5f5",
            cursor: "pointer",
          }}
        >
          +
        </button>
      </div>

      {/* Add to Cart */}
      <button
        onClick={() => onAddToCart(product, quantity)}
        style={{
          background: "#ff4d4d",
          color: "#fff",
          border: "none",
          padding: "10px 15px",
          borderRadius: "6px",
          cursor: "pointer",
          fontWeight: "bold",
        }}
      >
        Add to Cart
      </button>
    </div>
  );
};

export default ProductsPage;
